import styled from "styled-components";

const StyledCompBtn = styled.section`
  backgroundColor: ${(props) => props.background},
  padding: ${(props) => props.paddingParam} || 16px 36px,
  boxShadow: ${(props) => props.boxShadowParam},
  border: 1px solid #2d2a26,
  border-radius: 10px,
  font-weight: bold,
  transition: all 0.3s,
`;

const ButtonStyledComp = (props) => {
  console.log(props, "props");
  return <StyledCompBtn {...props} />;
};

export default ButtonStyledComp;
